<td colspan="8" style="text-indent: 0px; text-align: justify;">
<span style="font-family: Arial; color: #000000; font-size: 12px; line-height: 1.1499023;">1.1. Společnost a Investor uzavírají na základě této Rámcové smlouvy vzájemný smluvní vztah, v jehož rámci bude Společnost poskytovat Investorovi Služby.<br/><br/>1.2. Tato Rámcová smlouva může být měněna nebo doplněna pouze dodatky uzavřenými na dálku prostřednictvím Portálu, nevyplývá-li z VOP, OPP, OPPS, Sazebníku nebo Pravidel Portálu jinak.<br/><br/>1.3. Pojmy s velkými počátečními písmeny používané v této Rámcové smlouvě mají význam uvedený v Příloze VOP.<br/><br/>1.4. Jednotlivé smluvní závazky vzniklé na základě této Rámcové smlouvy se řídí, následujícími dokumenty, které jsou součástí této Rámcové smlouvy:</span></td>
